import React from 'react';
import ReactDOM from 'react-dom';

const date = new Date().toLocaleDateString();
const date1 = new Date().getHours();
const time = new Date().toLocaleTimeString();

console.log(date1);

if(date1 > 0 && date1 < 12 ){
    ReactDOM.render(
        <h1>Hello sir, Sir</h1>,
        document.getElementById('root'),
    )
}
else if(date1 >= 12 && date1 <= 16 ){
    ReactDOM.render(
        <h1>Hello sir, Good AfterNoon</h1>,
        document.getElementById('root'),
    )
}
else if(date1 > 16 && date1 <= 20 ){
    ReactDOM.render(
        <h1>Hello sir, Good Evening</h1>,
        document.getElementById('root'),
    )
}
else if(date1 > 20 && date1 <= 23){
    ReactDOM.render(
        <h1>Hello sir, Good Night</h1>,
        document.getElementById('root'),
    )
}
